const COLORS = {
    primary: '#122636',
    white: '#FFF',
    dark: '#000',
    light: '#f7f7f7',
    grey: '#A9A9A9',
    yellow: '#ffb900',
    red: 'red',
    tranparent: 'rgba(0,0,0,0)',
  };
  
  export default COLORS;
